// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "../../interfaces/ISettings.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../openzeppelin/contracts/token/ERC20/SafeERC20.sol";



pragma experimental ABIEncoderV2;

contract SimpleStrategy is Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    ISettings public Settings;

    mapping(address => uint256) public totalDeposits;

    mapping(address => mapping(address => uint256)) public vaultDeposits;

    uint256 public constant DEPOSIT_FEE_POINTS = 5;
    uint256 public constant DEPOSIT_FEE_BASE_POINTS = 1000;
    uint256 public constant FILLER_FEE_POINTS = 3;
    uint256 public constant FILLER_FEE_BASE_POINTS = 1000;
    uint256 public constant TX_FEE_POINTS = 7;
    uint256 public constant TX_FEE_BASE_POINTS = 1000;


    modifier onlyVault {
        require(Settings.vault(msg.sender), "CornFi Simple Strategy: Vault Only Function");
      _;
   }


    constructor(ISettings _settings) public {
        Settings = _settings;
    }


    function depositFee(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.mul(DEPOSIT_FEE_POINTS).div(DEPOSIT_FEE_BASE_POINTS);
    }


    function txFee(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.mul(TX_FEE_POINTS).div(TX_FEE_BASE_POINTS);
    }


    function fillerFee(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.mul(FILLER_FEE_POINTS).div(FILLER_FEE_BASE_POINTS);
    }


    function deposit(address _from, address _token, uint256 _amount) public onlyVault {
        if(_amount > 0) {
            IERC20(_token).transferFrom(_from, address(this), _amount);
            totalDeposits[_token] = totalDeposits[_token].add(_amount);
            vaultDeposits[msg.sender][_token] = vaultDeposits[msg.sender][_token].add(_amount);
        }
    }


    function withdraw(address _from, address _token, uint256 _amount) public onlyVault {
        // This prevents the owner from creating a malicious vault that could withdraw all tokens
        require(_amount <= vaultDeposits[msg.sender][_token], "CornFi Simple Strategy: Vault Withdraw Amount Exceeded");

        if(_amount > 0) {
            IERC20(_token).transfer(_from, _amount);
            totalDeposits[_token] = totalDeposits[_token].sub(_amount);
            vaultDeposits[msg.sender][_token] = vaultDeposits[msg.sender][_token].sub(_amount);
        }
    }


    function claimRewards() public onlyOwner {
        revert("CornFi Simple Strategy: Function Disabled");
    }
}
